import React from "react";

const Passcode = () => {
  return (
    <div className="searchCodeContainer">
      <p>
        <span style={{ fontSize: "xx-large" }}>You passcode is</span>
        <br />
        <span style={{ fontSize: "large" }}>Passcode</span>
      </p>
    </div>
  );
};

export default Passcode;
